
def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    subs = "" # substring template
    temp_s = s # given string
    list_of_subs =[] # array of all sub string


    # abcabcbb
    for i in range(0, len(temp_s)-1):
        for j in range(0, len(temp_s)-1):
            if(temp_s[i]!=temp_s[j]):

                subs += temp_s[i]
            else:
                temp_s = temp_s[j:-1]
        list_of_subs.append(subs)
    # sstr = "".join(subs)
    # return sstr
    return list_of_subs

